import { connect } from 'react-redux'
import ClassSynopsis from '../../components/content/ClassSynopsis'
import moduleName from '../../redux/reducers/classSynopsis'
function a(state) {
  // console.log(state);
  return {
    // classDetail:state.
    classDetail:state.classDetail
  }
}
function b(dispatch) {
  return {
    classDetail:(data)=>{dispatch(classDetail(data))}
  }
}
export default connect(a, b)(ClassSynopsis)
